import * as actionTypes from "./action-types.js";

const initialState = {
  pokemons: [],
  isError: false,
  isLoading: false,
};

export default function numberBasicReducer(
  state = initialState,
  { type, payload }
) {
  switch (type) {
    case actionTypes.INCREMENT:
      return state + 1;
    default:
      return state;
  }
}
